import React, { Component } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";

export default class Article4 extends Component {
  render() {
    return (
      <div>
        <Grid
          container
          direction="row"
          justify="center"
          alignitems="center"
          spacing={3}
        >
          <Grid lg={4} md={4} sm={6}>
            <div>Ini grid1</div>
          </Grid>
          <Grid lg={4} md={4} sm={6}></Grid>
          <Grid lg={4} md={4} sm={6}></Grid>
        </Grid>
      </div>
    );
  }
}
